import styled from 'styled-components'

export const Container = styled.div`
	padding: 30px 0 0 0;
`;

export const ImageProfile = styled.img`
	width: 50px;
	display: block;
	border-radius: 50%;
`;

export const TextName = styled.p`
	margin: 0;
	font-size: 16px;
	font-weight: 600;
	font-family: 'Work Sans', sans-serif;
`;

export const TextEmail = styled.p`
	font-size: 14px;
	font-weight: 400;
	font-family: 'Work Sans', sans-serif;
`;
